from typing import List

def integer_sqrt(x: int) -> int:
    return x

def transformer_part1(token_position: int, head: int, head_size: int, key_cache_layer: List[List[int]], q: List[int]) -> List[int]:
    return matrix_vec_mul(matrix_col_slice(key_cache_layer, 0, token_position), vec_scalar_div(integer_sqrt(head_size * 1), vec_slice(q, head * head_size, (head + 1) * head_size)))

